import React from 'react';
import "./slider.css"
import '../../App.css';

function Slider() {
    return (
        <div>
            <div id="slider">
                <div class="container">
                    <div class="slider_content">
                        <div class="toggle_btn"><>Миссия</></div>
                       <p>Коомдун билим берүү, илим, экономика жана социалдык чөйрөсүн ѳнүктүрүүгѳ жана атаандаштыкка жѳндѳмдүү адистерди даярдоо; коомдун адеп-ахлактык, маданий жана илимий баалуулуктарын сактоого жана арттырууга ѳбѳлгѳ болуу; кѳп маданияттуу билим берүү аркылуу Борбордук Азияда жашаган элдердин ортосундагы достукту бекемдѳѳ.</p> 
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Slider;
